import styled from "styled-components"

const Input = styled.input`
    width:80vw;
    height: 1.3rem;
    background-color: #00000040;
    border:1px solid #ffffff40;
    border-radius:.2rem;

    &:before{
        content:$props.title}}
    }
`
export default Input;
